import React, { Component } from 'react';
import Myapp from './info';
class Root extends Component {

    render() { 
        var a =localStorage.length;
        if(a != 0)
        {
        return ( <div>
            <h1>WELCOME!!!</h1>
        </div>);
        }
        else{
            return(
                <div>
                       <Myapp />
                 </div>
            )
        }
    }
}

export default Root;
